import { useState } from "react";

export default function Signup() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [birthDate, setBirthDate] = useState('');
  const [education, setEducation] = useState('');
  const [contact, setContact] = useState('');
  const [email, setEmail] = useState('');
  const [errors, setErrors] = useState({
    firstName: '',
    lastName: '',
    birthDate: '',
    education: '',
    contact: '',
    email: ''
  });

  const validateField = (fieldName, value) => {
    let errorMessage = '';

    if (!value.trim()) {
      errorMessage = `${fieldName.charAt(0).toUpperCase() + fieldName.slice(1)} is required.`;
    } else if (fieldName === 'email' && !/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(value)) {
      errorMessage = 'Invalid email address.';
    }

    setErrors(prevErrors => ({
      ...prevErrors,
      [fieldName]: errorMessage
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const formValid = Object.values(errors).every(error => error === '');

    if (formValid) {
      console.log('Form submitted:', {
        firstName,
        lastName,
        birthDate,
        education,
        contact,
        email,
      });
    } else {
      console.log('Form contains errors. Please fix them.');
    }
  };

  return (
    <div className="container">
      <h2 className="mt-5 mb-4">Student Registration Form</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">First Name:</label>
          <input
            type="text"
            className="form-control"
            value={firstName}
            onChange={(e) => {
              setFirstName(e.target.value);
              validateField('firstName', e.target.value);
            }}
          />
          {errors.firstName && <p className="text-danger">{errors.firstName}</p>}
        </div>
        <div className="mb-3">
          <label className="form-label">Last Name:</label>
          <input
            type="text"
            className="form-control"
            value={lastName}
            onChange={(e) => {
              setLastName(e.target.value);
              validateField('lastName', e.target.value);
            }}
          />
          {errors.lastName && <p className="text-danger">{errors.lastName}</p>}
        </div>
        <div className="mb-3">
          <label className="form-label">Birth Date:</label>
          <input
            type="date"
            className="form-control"
            value={birthDate}
            onChange={(e) => {
              setBirthDate(e.target.value);
              validateField('birthDate', e.target.value);
            }}
          />
          {errors.birthDate && <p className="text-danger">{errors.birthDate}</p>}
        </div>
        <div className="mb-3">
          <label className="form-label">Education:</label>
          <input
            type="text"
            className="form-control"
            value={education}
            onChange={(e) => {
              setEducation(e.target.value);
              validateField('education', e.target.value);
            }}
          />
          {errors.education && <p className="text-danger">{errors.education}</p>}
        </div>
        <div className="mb-3">
          <label className="form-label">Contact:</label>
          <input
            type="text"
            className="form-control"
            value={contact}
            onChange={(e) => {
              setContact(e.target.value);
              validateField('contact', e.target.value);
            }}
          />
          {errors.contact && <p className="text-danger">{errors.contact}</p>}
        </div>
        <div className="mb-3">
          <label className="form-label">Email:</label>
          <input
            type="email"
            className="form-control"
            value={email}
            onChange={(e) => {
              setEmail(e.target.value);
              validateField('email', e.target.value);
            }}
          />
          {errors.email && <p className="text-danger">{errors.email}</p>}
        </div>
        <button type="submit" className="btn btn-primary">Submit</button>
      </form>
    </div>
  );
}
